import React from 'react';
import './ProfilePage.css';
import driverPhoto from './images.jpeg';

function ProfilePage() {
  const driverProfile = {
    fullName: 'Name Surname',
    phoneNumber: '+1234567890',
    email: 'sample@gmail.com',
    languages: 'English, Spanish',
    rating: 4.5,
  };

  return (
    <div className="profile-page">
      <h2>User Profile</h2>
      <div className="profile-photo">
        <img src={driverPhoto} alt="Driver" /> {}
      </div>
      <div className="profile-info">
        <p><strong>Name:</strong> {driverProfile.fullName}</p>
        <p><strong>Phone Number:</strong> {driverProfile.phoneNumber}</p>
        <p><strong>Email:</strong> {driverProfile.email}</p>
        <p><strong>Languages Spoken:</strong> {driverProfile.languages}</p>
        <p><strong>Rating:</strong> {driverProfile.rating} / 5</p>
      </div>
    </div>
  );
}

export default ProfilePage;
